import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';



const useStyles = makeStyles((theme) => ({
    heroContent: {
      padding: theme.spacing(8, 0, 6),
    },
    img: {
      minHeight: "100vh",
      backgroundImage: `url(${process.env.PUBLIC_URL + "/images/telephone.jpg"})`,
      backgroundRepeat: "no-repeat",
      backgroundSize: "cover"
    },
    profileImg: {
      size:"10px"
    }

  }));

function Contact() {
    const classes = useStyles();
    return (
        <div className={classes.img}>
    <React.Fragment>
      <CssBaseline />
      <main>
        {/* Hero unit */}
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              Contact
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
            </Typography>
          </Container>
        </div>
        <Container className={classes.cardGrid} maxWidth="md">

        <div>
          <img className={classes.profileImg} style={{borderRadius:"50%"}}src="/images/profile.jpg" alt=""/>
        </div>

        <Typography variant="h5" align="center" gutterBottom>E-mail: Johnrrukaj@gmail.com</Typography>

        <Typography variant="h5" align="center" gutterBottom>Mobile: 07432481567</Typography>

        <Typography variant="h5" align="center" gutterBottom>LinkedIn: in/JohnRrukaj</Typography>

        <Typography variant="h5" align="center" gutterBottom>Github: Github.com/j-rrukaj</Typography>





        </Container>
      </main>

    </React.Fragment>
        </div>
    )
}

export default Contact
